import { useEffect, useState } from "react";
import axios from "axios";

export default function Loans() {
  const [loans, setLoans] = useState([]);

  useEffect(() => {
    axios.get("http://localhost:5000/loans").then((res) => {
      setLoans(res.data);
    });
  }, []);

  return (
    <div>
      <h1>Împrumuturi</h1>

      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Utilizator</th>
            <th>Carte</th>
            <th>Data împrumut</th>
            <th>Data retur</th>
          </tr>
        </thead>

        <tbody>
          {loans.map((loan) => (
            <tr key={loan.id}>
              <td>{loan.id}</td>
              <td>{loan.user_name}</td>
              <td>{loan.book_title}</td>
              <td>{loan.start_date}</td>
              <td>{loan.end_date || "Nereturnată"}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
